import Staffs from "./containers/Staffs/Staff";
import Movies from "./containers/Movies/Movies";
import Receipts from "./containers/Receipts/Receipt";
import Sesions from "./containers/Sessions/Session";
import Categories from "./containers/Categories/Category";
import Cinemas from "./containers/Cinemas/Cinema";

export const navMenu = [
    {
        id: '1',
        name: 'Tổng quan',
        route: '/total',
        Comp: Movies,
        role: ['staff', 'admin']
    },
    {
        id: '2',
        name: 'Nhân viên',
        route: '/staff',
        Comp: Staffs,
        role: ['admin']
    },
    {
        id: '3',
        name: 'Hoá đơn',
        route: '/receipt',
        Comp: Receipts,
        role: ['admin']
    },
    {
        id: '4',
        name: 'Phim',
        route: '/movie',
        Comp: Movies,
        role: ['admin']
    },
    {
        id: '5',
        name: 'Suất chiếu',
        route: '/session',
        Comp: Sesions,
        role: ['admin']
    },
    {
        id: '6',
        name: 'Thể loại phim',
        route: '/cateogry',
        Comp: Categories,
        role: ['admin']
    },
    {
        id: '7',
        name: 'Rạp phim',
        route: '/cinema',
        Comp: Cinemas,
        role: ['admin']
    }
]
